    id INT PRIMARY KEY,
    simulation_name VARCHAR(255),
    parameter_name VARCHAR(255),
    parameter_value FLOAT
);

CREATE TABLE simulation_constants (
    id INT PRIMARY KEY,
    constant_name VARCHAR(255),
    constant_value FLOAT
);

CREATE TABLE SimulationParameters (
  simulation_id INT PRIMARY KEY,
  simulation_name VARCHAR(50),
  simulation_description TEXT,
  simulation_date DATE
);

CREATE TABLE Constants (
  constant_id INT PRIMARY KEY,
  constant_name VARCHAR(50),
  constant_value FLOAT,
  constant_unit VARCHAR(20)
);

CREATE TABLE SimulationParameters (
    id INT PRIMARY KEY,
    simulation_name VARCHAR(50),
    simulation_date TIMESTAMP,
    simulation_description TEXT
);

CREATE TABLE QuantumSimulations (
    id INT PRIMARY KEY,
    simulation_name VARCHAR(50),
    simulation_date TIMESTAMP,
    simulation_results JSON
);

CREATE TABLE SimulationResearchers (
    id INT PRIMARY KEY,
    researcher_name VARCHAR(50),
    researcher_email VARCHAR(50),
    researcher_affiliation VARCHAR(100)
);

CREATE TABLE SimulationParameters (
  simulation_id INT PRIMARY KEY,
  parameter_name VARCHAR(50) NOT NULL,
  parameter_value VARCHAR(100) NOT NULL
);

CREATE TABLE SimulationConstants (
  constant_id INT PRIMARY KEY,
  constant_name VARCHAR(50) NOT NULL,
  constant_value FLOAT NOT NULL
);

CREATE TABLE QuantumSimulations (
  simulation_id INT PRIMARY KEY,
  simulation_name VARCHAR(100) NOT NULL,
  simulation_date DATE NOT NULL
);

CREATE TABLE SimulationResults (
  result_id INT PRIMARY KEY,
  simulation_id INT NOT NULL,
  result_data TEXT NOT NULL,
  result_timestamp TIMESTAMP NOT NULL
);

CREATE TABLE SimulationLogs (
  log_id INT PRIMARY KEY,
  simulation_id INT NOT NULL,
  log_text TEXT NOT NULL,
  log_timestamp TIMESTAMP NOT NULL
);
